#
# extratexts: must be included even if the string is empty, it is a quirk in ModArgparser.py
#
# size: is normally 2 dimensional, creaing a box, in this case 6x6 mm
#  size: [6.00, 6.00]
#
# But it is possible to define how the corners should look like with following optional parameters
#
# ULR : Upper left corner with arc
# ULP: Upper left corner with rectangular cut
#
# URR : Upper right corner with arc
# URP: Upper right corner with rectangular cut
#
# LRR : Lower right corner with arc
# LRP: Lower right corner with rectangular cut
#
# LLR : Lower left corner with arc
# LLP: Lower left corner with rectangular cut
#
#
#   size: [6.00, 6.00, ['ULP', 0.9, 0.9]]
# means a box of 6x6 mm but upper left corner is cut 0.9 mm both in x and y led
#
#   size: [6.00, 6.00, ['ULR', 0.2], ['LRP', 0.9, 0.9]]
# means a box of 6x6 mm but upper left corner is cut by an arc with radius 0.2
# and lower right corner is cut 0.9 in both x and y led
#
#

